import {
  FullSwiper
} from "./FullSwiper";
import {SwiperContainer} from "./SwiperElements"
export function ProductSwipe () {
  console.log("graphics removed")
  const PartSwiper = useRef(null);
  PartSwiper.update();
  for (let i = 0; i < 7; i += 1) {
    PartSwiper.removeSlides(i);
  }
}
const SwiperSection = () => {

  return (
    <SwiperContainer>
      <FullSwiper ref={PartSwiper}/>
    </SwiperContainer>
  );
};

export default SwiperSection;
